/*convert c[species] (molar conc) to x[species] (mole fracs) */
void CKCTX(double * c, int * iwrk, double * rwrk, double * x)
{
    int id; /*loop counter */
    double sumC = 0; 

    /*compute sum of c  */
    for (id = 0; id < 107; ++id) {
        sumC += c[id];
    }

    /* See Eq 13  */
    for (id = 0; id < 107; ++id) {
        x[id] = c[id]/sumC;
    }

    return;
}


