        k_f_save[7] = 1e-06 * 1.475e+12*exp(0.6*tc[0]);
        k_f_save[8] = 1e-06 * 1.97e+14*exp(-8323.1583629101423867*invT);
        k_f_save[9] = 1e-06 * 4.2e+14*exp(-6028.495399007278138*invT);
        k_f_save[10] = 1e-06 * 1.66e+13*exp(-412.65276245984426851*invT);
        k_f_save[11] = 1e-06 * 2.89e+13*exp(+251.60833290235981963*invT);
        k_f_save[12] = 1e-06 * 7.08e+13*exp(-150.93983890812566528*invT);
        k_f_save[13] = 1e-06 * 3.25e+13;
        k_f_save[14] = 1e-06 * 1.3e+11*exp(+819.77014159583666242*invT);
