    kc[37] = exp((g_RT[15] + g_RT[7]) - (g_RT[16] + g_RT[9]));

    /*reaction 39: CH2GSG + CH3 => C2H4 + H */
    kc[38] = exp((g_RT[65] + g_RT[15]) - (g_RT[17] + g_RT[5]));

    /*reaction 40: CH3 + OH <=> CH2 + H2O */
    kc[39] = exp((g_RT[15] + g_RT[6]) - (g_RT[11] + g_RT[8]));

    /*reaction 41: OH + CH3 (+M) <=> CH3OH (+M) */
    kc[40] = 1.0 / (refC) * exp((g_RT[6] + g_RT[15]) - (g_RT[18]));

    /*reaction 42: 2 CH3 <=> H + C2H5 */
